def lis(l):
    a = [[] for i in l]

    a[0].append(l[0])

    for i in range(1, len(l)):
        for j in range(i):
            if int(l[i]) > int(l[j]) and len(a[j]) > len(a[i]):
                a[i] = a[j].copy()
        a[i].append(l[i])
    return a

